import React, { useState } from 'react';
import { Link } from 'react-router-dom'; // If using React Router for navigation
import './Signup.css'; // Make sure this path is correct

const SignupForm = () => {
  const [fullName, setFullName] = useState('');
  const [email, setEmail] = useState('');
  const [phoneNumber, setPhoneNumber] = useState('');
  const [farmName, setFarmName] = useState('');
  const [farmAddress, setFarmAddress] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [agreeTerms, setAgreeTerms] = useState(false);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Here you would typically handle form submission
    // For example, you might send this data to a backend server for processing
    // After successful submission, you may want to clear the form fields
    clearForm();
  };

  const clearForm = () => {
    setFullName('');
    setEmail('');
    setPhoneNumber('');
    setFarmName('');
    setFarmAddress('');
    setPassword('');
    setConfirmPassword('');
    setAgreeTerms(false);
  };

  return (
    <div>
      {/* Navigation Header */}
      <nav className="navigation">
        <Link to="/" className="logo">
          <img src={require('./uss.png')} alt="logo" className="logo-img" />
        </Link>
        <div className="nav-links">
          <Link to="/signup" className="nav-link">
            Become a seller
          </Link>
          <Link to="/login" className="nav-link">
            Login
          </Link>
          <Link to="/signup" className="nav-link">
            Signup
          </Link>
        </div>
      </nav>

      {/* Main Signup Content */}
      <div className="main-content">
        <div className="signup-form">
          <h2>Sign Up for Farmer of our Local Farmer's Market!</h2>
          <form onSubmit={handleSubmit}>
            <label>
              Full Name:
              <input
                type="text"
                placeholder="Enter your full name"
                value={fullName}
                onChange={(e) => setFullName(e.target.value)}
              />
            </label>
            <label>
              Email:
              <input
                type="email"
                placeholder="Enter your email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </label>
            <label>
              Phone Number:
              <input
                type="tel"
                placeholder="Enter your phone number"
                value={phoneNumber}
                onChange={(e) => setPhoneNumber(e.target.value)}
              />
            </label>
            <label>
              Farm Name:
              <input
                type="text"
                placeholder="Enter your farm name"
                value={farmName}
                onChange={(e) => setFarmName(e.target.value)}
              />
            </label>
            <label>
              Farm Address:
              <input
                type="text"
                placeholder="Enter your farm address"
                value={farmAddress}
                onChange={(e) => setFarmAddress(e.target.value)}
              />
            </label>
            <label>
              Password:
              <input
                type="password"
                placeholder="Create a password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </label>
            <label>
              Confirm Password:
              <input
                type="password"
                placeholder="Confirm your password"
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
              />
            </label>
            <label className="terms">
              <input
                type="checkbox"
                checked={agreeTerms}
                onChange={() => setAgreeTerms(!agreeTerms)}
              />
              I agree to the terms and conditions
            </label>
            <button type="submit" disabled={!agreeTerms}>
              Sign Up
            </button>
          </form>
          <p>
            Already have an account? <Link to="/login">Login</Link>
          </p>
        </div>
      </div>
    </div>
  );
}

export default SignupForm;
